import React, { Component } from "react";
import Layout from "../../../components/Layout";

class Index extends Component{
    render(){
        return(
            <Layout>
                <div className="container">
                    <h1>The Resume Game</h1>
                </div>                 
            </Layout>               
        )
    }
}

export default Index;
